PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "nights" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "start_date" datetime, "end_date" datetime, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "observations" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "observation_number" integer, "night_id" integer, "log" text, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "measurements" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "mjd" float, "sky_background" float, "humidity" float, "ambient_temp" float, "ccd_temp" float, "fwhm" float, "created_at" datetime, "updated_at" datetime, "observation_id" integer, "airmass" float, "tel_ra" float, "tel_dec" float, "exposure_time" float, "moon_distance" float, "sun_distance" float);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE INDEX "index_measurements_on_observation_id" ON "measurements" ("observation_id");
CREATE INDEX "index_observations_on_night_id" ON "observations" ("night_id");
COMMIT;
